Normally you would integrate the camera DeadeyeF0 class above into a robot Subsystem and activate from a Command but we'll keep it simple for the purposes of this example. Make the following additions to the standard Robot class in src/main/java/frc/robot/Robot.java. Initialize our robot's DeadeyeF0 object in the robotInit() method. private DeadeyeF0 deadeyeF0; @Override
public void robotInit() { // ... deadeyeF0 = new DeadeyeF0();
} Enable camera F0 when enabling the robot in tele-operation mode. @Override
public void teleopInit() { // ... deadeyeF0.setEnabled(true);
} And disable the camera when disabling the robot. @Override
public void disabledInit() { deadeyeF0.setEnabled(false);
}
